import React, { Component } from "react";
import { connect } from 'react-redux';
import { Link } from 'react-router-dom';
import logo from "../images/logo.png";
import { Navbar, Nav, Img } from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
import '../css/app.css';

const navStyle = {
  backgroundColor:'red',
};

<a className="white btn-flat right black-text waves-effect waves-red" href="/auth/google">
						<SocialIcon network="google" style={imgStyle}/>
						Login With Google
					</a>

class Header extends Component {
  render() {
    return (
      <Navbar fixed="top" bg="lt" expand="lg">
        <Navbar.Brand href="/">
          <img className="logo" src={logo} />
          <h5 className="name">VAUGN'S A/C &amp; HEATING</h5>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ml-auto">
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link href="/Services">Services</Nav.Link>
            <Nav.Link href="/ContactUs">Contact Us</Nav.Link>
            <Nav.Link href="/AboutUs">About Us</Nav.Link>
            <Nav.Link href="/auth/google">
              <SocialIcon network="google" style={imgStyle}/>
						  Login With Google
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    );
  }
}

function mapStateToProps({ auth }) {
	return { auth };
}

export default connect(mapStateToProps)(Header);
